import "./App.css";
import Axios from "axios";

function App() {
  const [joke, setJoke] = useS
  const getJoke = () => {
    Axios.get(
      "https://official-joke-api.appspot.com/random_joke"
    ).then((response) => console.log(response));
  };
  return (
    <div className="App">
      Hello YouTube!
      <button onClick={getJoke}>Click For Joke</button>
    </div>
  );
}

export default App;
